require 'json'

class ResultsParser

  attr_reader :raw_har

  def initialize(args)
    @raw_har = args.fetch(:raw_har)
  end

  def parse_entries
    hash = {}
    pages.each do |page|
      hash[page['id']] = map_entries.select { |x| x['pageref'] == page['id'] }
    end
    hash
  end

  def pages
    raw_har['pages'].each { |x| x['id'] }
  end

  def map_entries(&block)
    raw_har['entries']
  end

end

